<div class="text-container"><span id="t1_1" class="t s1_1">VOORWERP, DUUR EN PRIJS </span><span id="t2_1" class="t s2_1">(In geval van meerkeuze, gelieve slechts één vakje aan te kruisen) </span>
<span id="t3_1" class="t s3_1">Contract tussen </span><span id="t4_1" class="t s4_1">de klant </span><span id="t5_1" class="t s3_1">en </span><span id="t6_1" class="t s4_1">Electrabel nv</span><span id="t7_1" class="t s3_1">, met hoofdkantoor te Simon Bolivarlaan 34 in 1000 Brussel, btw BE 0403.170.701 RPR Brussel. </span><span id="t8_1" class="t s5_1">Hierna respectievelijk ‘u’ of ‘de klant’ </span>
<span id="t9_1" class="t s5_1">en ‘wij’ of ‘ENGIE Electrabel’ genoemd. </span>
<span id="ta_1" class="t s3_1" data-mappings='[[115,"fi"]]'>De aanbiedingen, bijhorende prijsvoorwaarden en diensten worden toegelicht in de Bijzondere Voorwaarden en de prijsﬁches waarvan u erkent kennis te hebben genomen. Met </span>
<span id="tb_1" class="t s3_1">uw contract kunt u elektriciteit en/of aardgas afnemen bij ENGIE Electrabel voor het hoger vermelde Afnamepunt. </span>
<span id="tc_1" class="t s3_1">Indien er een of meerdere meters moeten worden geopend/gesloten, worden de kosten hiervoor aangerekend aan de Klant. </span>
<span id="td_1" class="t s3_1">In geval van verhuis, gelieve het bijgevoegde ‘Energieovernamedocument’ in te vullen en te ondertekenen. </span>
<span id="te_1" class="t s6_1">U hebt al een contract bij ENGIE Electrabel </span><span id="tf_1" class="t s6_1">U hebt nog geen contract bij ENGIE Electrabel </span><span id="tg_1" class="t s6_1">U hebt nog nooit een energiecontract gehad </span>
