<span id="t1y_1" class="t sj_1">Document ID: </span><span id="t1z_1" class="t sj_1">Gegevens van de klant </span>
<span id="t20_1" class="t sl_1">(1) </span>
<span id="t21_1" class="t v0_1 sk_1">Firmanaam </span><span id="t22_1" class="t v1_1 se_1">J</span><span id="t23_1" class="t v0_1 sk_1">uridische vorm </span>
<span id="t24_1" class="t sk_1">Naam </span><span id="t25_1" class="t sk_1">Voornaam </span>
