<span id="t27_1" class="t sl_1">(2) </span>
<span id="t28_1" class="t v0_1 sk_1">NACE code </span>
<span id="t29_1" class="t sk_1">Tel </span><span id="t2a_1" class="t sk_1">Gsm </span>
<span id="t2b_1" class="t sk_1">E-mail </span>
<span id="t2c_1" class="t sm_1">U wenst de correspondentie met ENGIE Electrabel over uw contract(en) via e-mail te ontvangen </span>
<span id="t2d_1" class="t sm_1">(zie ook de Bijzondere Voorwaarden). </span>
<span id="t2e_1" class="t sm_1">U wenst via e-mail op de hoogte te blijven van de producten, diensten en promoties van ENGIE Electrabel </span>
<span id="t2f_1" class="t sm_1" data-mappings='[[26,"fi"]]'>inzake energie, energie-efﬁciëntie, productie en opslag van energie, onderhoud en pechbijstand, smart </span>
<span id="t2g_1" class="t sm_1">producten en e-mobility en van haar partners inzake verwarming, isolatie en zonnepanelen. </span>
<span id="t2h_1" class="t sk_1">BTW </span><span id="t2i_1" class="t sk_1">BE </span><span id="t2j_1" class="t sk_1">RPR </span>
<span id="t2k_1" class="t sn_1">Verzendadres </span><span id="t2l_1" class="t so_1">(Te vervolledigen indien verschillend van leveringsadres.) </span>
<span id="t2m_1" class="t v0_1 sk_1">Firmanaam </span><span id="t2n_1" class="t v1_1 se_1">J</span><span id="t2o_1" class="t v0_1 sk_1">uridische vorm </span>
<span id="t2p_1" class="t sk_1">Naam </span><span id="t2q_1" class="t sk_1">Voornaam </span>
<span id="t2r_1" class="t sk_1">Straat </span><span id="t2s_1" class="t sk_1">Nr. </span><span id="t2t_1" class="t sk_1">Bus </span>
<span id="t2u_1" class="t sk_1">Postcode </span><span id="t2v_1" class="t sk_1">Plaats </span>
<span id="t2w_1" class="t sp_1">ENGIE Electrabel stuurt u een schriftelijke bevestiging van uw contract(en). Vanaf de Ontvangstdag van de schriftelijke bevestiging heeft u </span>
<span id="t2x_1" class="t sp_1">14 kalenderdagen om ons schriftelijk mee te delen dat u ervan afziet, zonder opgave van redenen. Uw schrijven dient gericht te zijn voor het </span>
<span id="t2y_1" class="t sp_1">Vlaams Gewest aan Electrabel, Postbus 10070, 2600 Berchem en voor het Waals en het Brussels Hoofdstedelijk Gewest aan Electrabel, Boîte </span>
<span id="t2z_1" class="t sp_1">Postale 10070, 5000 Namur. U kunt hiervoor gebruikmaken van de modeltekst voor herroeping die u terugvindt in de schriftelijke bevestiging </span>
<span id="t30_1" class="t sp_1">van het (de) Contract(en), maar u bent hiertoe niet verplicht. Als u ons verzocht heeft om de levering van elektriciteit en/of aardgas te laten </span>
<span id="t31_1" class="t sp_1">beginnen zonder het einde van de herroepingstermijn af te wachten, en u alsnog gebruik maakt van uw herroepingsrecht, betaalt u een </span>
<span id="t32_1" class="t sp_1">bedrag dat overeenstemt met de reeds door ENGIE Electrabel geleverde elektriciteit en/of aardgas in overeenstemming met het Wetboek van </span>
<span id="t33_1" class="t sp_1">economisch recht. Dit bedrag wordt berekend op basis van de totale prijs zoals vastgelegd in het contract en de door de distributienetbeheerder </span>
<span id="t34_1" class="t sp_1">gevalideerde verbruiksgegevens. </span>
<span id="t35_1" class="t s1_1">BETALINGSMODALITEITEN </span>
<span id="t36_1" class="t sq_1">U opteert voor </span>
<span id="t37_1" class="t se_1">maandelijks </span><span id="t38_1" class="t se_1">tweemaandelijks </span><span id="t39_1" class="t se_1">driemaandelijks voorschot </span>
<span id="t3a_1" class="t sq_1">U wenst uw facturen en de bijbehorende correspondentie te ontvangen </span>
<span id="t3b_1" class="t se_1">via e-mail (zie ook de Bijzondere voorwaarden) </span><span id="t3c_1" class="t se_1">per post </span>
<span id="t3d_1" class="t sq_1">U betaalt </span><span id="t3e_1" class="t se_1">per overschrijving </span><span id="t3f_1" class="t se_1">via domiciliëring </span><span id="t3g_1" class="t se_1">via een nieuwe </span>
<span id="t3h_1" class="t se_1">domiciliëring met het rekeningnummer IBAN </span>
<span id="t3i_1" class="t sr_1">(5) </span>
<span id="t3j_1" class="t s1_1">HANDTEKENING </span>
<span id="t3k_1" class="t v1_1 ss_1">Verstuur dit document naar Partner Line: via e-mail naar partnerlinenl.electrabel@engie.com, per post: Antwoordcode Electrabel – Partner Line, DA 852 – 546 – 3, 2600 Berchem of via fax naar 03 280 02 07 </span>
<span id="t3l_1" class="t sq_1">Opgemaakt in drie originele exemplaren, te </span>
<span id="t3m_1" class="t se_1">op </span>
<span id="t3n_1" class="t se_1">/ </span><span id="t3o_1" class="t se_1">/ </span><span id="t3p_1" class="t se_1">, waarvan de klant erkent één exemplaar te hebben ontvangen. </span>
<span id="t3q_1" class="t v2_1 s8_1">De Klant verklaart kennis genomen te hebben van de inhoud van dit (deze) Contract(en) dat (die) </span>
<span id="t3r_1" class="t v2_1 s8_1">bestaat (bestaan) uit dit document, de Algemene Voorwaarden voor professionele klanten, de </span>
<span id="t3s_1" class="t v2_1 s8_1" data-mappings='[[34,"fi"]]'>Bijzondere Voorwaarden en de prijsﬁches, alsook deze te accepteren. Met zijn handtekening erkent </span>
<span id="t3t_1" class="t v2_1 s8_1">de klant dat hij zich verbindt tegenover ENGIE Electrabel en dat hij geen openstaande schulden heeft </span>
<span id="t3u_1" class="t v2_1 s8_1">bij ENGIE Electrabel. </span>
<span id="t3v_1" class="t v2_1 s8_1">Ondertekend door </span>
<span id="t3w_1" class="t st_1">Voor Electrabel nv</span><span id="t3x_1" class="t su_1">: </span><span id="t3y_1" class="t st_1">Voor de Klant</span><span id="t3z_1" class="t su_1">: </span>
<span id="t40_1" class="t sv_1">Naam</span><span id="t41_1" class="t sw_1">: </span>
<span id="t42_1" class="t sv_1">[Handtekening] </span>
