<span id="t44_1" class="t sk_1">Straat </span>
<span id="t45_1" class="t sk_1">Nr </span><span id="t46_1" class="t sk_1">Bus </span><span id="t47_1" class="t sk_1">Verdieping </span><span id="t48_1" class="t sk_1">Appartement </span>
<span id="t49_1" class="t sk_1">Postcode </span><span id="t4a_1" class="t sk_1">Plaats </span>
