<span id="t4l_1" class="t v3_1 sx_1">(2) </span>
<span id="t4m_1" class="t v4_1 sv_1">Enkel in te vullen indien u al ENGIE Electrabel klant bent. </span>
<span id="t4n_1" class="t v3_1 sx_1">(3) </span>
<span id="t4o_1" class="t v4_1 sv_1">Uw Contract wordt nadien verdergezet voor telkens 1 jaar of 3 jaar in geval van Easy3 pro vast. Tenzij anders vermeld in de Algemene Voorwaarden, kan u uw Contract(en) </span>
<span id="t4p_1" class="t v4_1 sv_1">op ieder moment opzeggen, zonder verbrekingsvergoeding, mits het respecteren van een schriftelijke opzeg van 1 maand. </span>
<span id="t4q_1" class="t v3_1 sx_1">(4) </span>
<span id="t4r_1" class="t v4_1 sv_1">Enkel in te vullen voor een nieuwe klant, nieuw adres of voor bestaande klanten die kiezen voor een nieuwe energie. </span>
