<span id="t4t_1" class="t v4_1 sv_1">We zullen u per brief een mandaat toesturen. Bezorg het ons ondertekend </span>
<span id="t4u_1" class="t v4_1 sv_1">en gedateerd terug. Zonder dit document kunnen we uw domiciliëring niet activeren. </span>
