<!-- Begin text definitions (Positioned/styled in CSS) -->
<div class="text-container"><span id="t1_2" class="t s1">1 Contract </span>
<span id="t2_2" class="t s2">Uw Contract met ENGIE Electrabel bestaat uit deze Algemene Voorwaarden (AV), de Bijzondere Voorwaarden en de </span>
<span id="t3_2" class="t s2">prijzen (BV). In geval van tegenstrijdigheid hebben de BV voorrang op de AV. </span>
<span id="t4_2" class="t s2">Uw Contract heeft betrekking op de levering van elektriciteit of aardgas (energie) of op de producten en/of diensten </span>
<span id="t5_2" class="t s2">die u los van uw energie aankoopt. Er wordt telkens een afzonderlijk Contract afgesloten voor elk van deze energieën, </span>
<span id="t6_2" class="t s2">deze producten en/of diensten. </span>
<span id="t7_2" class="t s2">Indien wij u de mogelijkheid bieden om onze contractuele voorwaarden te aanvaarden door gebruik te maken van een </span>
<span id="t8_2" class="t s2">webformulier of e-mail of een unieke code die u telefonisch of via een webapplicatie activeert, dan vormt het feit dat u </span>
<span id="t9_2" class="t s2">daarvan gebruik maakt een geldig bewijs in rechte van uw aanvaarding van onze contractuele voorwaarden. </span>
<span id="ta_2" class="t s2">Indien wij uw standaardleverancier zijn is dit Contract van toepassing krachtens de wettelijke voorschriften die ENGIE </span>
<span id="tb_2" class="t s2">Electrabel hebben aangeduid als standaardleverancier. </span>
<span id="tc_2" class="t s1">2. Definities </span>
<span id="td_2" class="t s2">- Het Afnamepunt is het punt waar wij u elektrisch vermogen of aardgas ter beschikking stellen. Het is geïdentificeerd </span>
<span id="te_2" class="t s2">in de BV door een adres en heeft een unieke EAN-code. </span>
<span id="tf_2" class="t s2">- De Netwerkkosten zijn de tarieven voor het gebruik van het distributienet en voor de ondersteunende diensten, even- </span>
<span id="tg_2" class="t s2">als de periodieke tarieven voor de aansluiting op het distributienet voor elektriciteit of aardgas, alsook de tarieven </span>
<span id="th_2" class="t s2">voor het gebruik van het transportnet voor elektriciteit of aardgas. </span>
<span id="ti_2" class="t s2">- De Ontvangstdag/Ontvangst is de derde werkdag na de verzending van het document. Een werkdag is elke dag van </span>
<span id="tj_2" class="t s2">de week met uitzondering van zaterdagen, zondagen en wettelijke feestdagen. </span>
<span id="tk_2" class="t s1">3. Aanvang, duur en beëindiging </span>
<span id="tl_2" class="t s2">3.1. De BV bepalen de duur van het Contract. De duur van het Contract begint te lopen op de datum van aanvang van </span>
<span id="tm_2" class="t s2">de levering. Tenzij anders bepaald in de BV, wordt een Contract van bepaalde duur verder gezet voor telkens één jaar. </span>
<span id="tn_2" class="t s2">De levering van energie kan maar aanvangen op voorwaarde dat: </span>
<span id="to_2" class="t s2">ENGIE Electrabel als leverancier voor het Afnamepunt in het toegangsregister van de distributienetbeheerder (DNB) </span>
<span id="tp_2" class="t s2">is geregistreerd; </span>
<span id="tq_2" class="t s2">uw aansluiting al is aangesloten op het distributienet en niet buiten dienst is gesteld; en </span>
<span id="tr_2" class="t s2">in het geval van een nieuwe aansluiting of een afgesloten aansluiting, de opening van de meters door de DNB is </span>
<span id="ts_2" class="t s2">uitgevoerd. </span>
<span id="tt_2" class="t s2">3.2. De levering kan maar aanvangen na afloop van uw herroepingstermijn, dit is de termijn waarbinnen u ons schrif- </span>
<span id="tu_2" class="t s2">telijk kan meedelen dat u het Contract dat u met ons hebt afgesloten wenst te herroepen. Indien u het Contract </span>
<span id="tv_2" class="t s2">telefonisch hebt afgesloten, dient u uw Contract te bevestigen, en beschikt u vervolgens over een herroepingstermijn </span>
<span id="tw_2" class="t s2">van 14 kalenderdagen te rekenen vanaf onze Ontvangst van uw bevestiging. Indien u het Contract op een andere wijze </span>
<span id="tx_2" class="t s2">dan telefonisch hebt afgesloten, beschikt u over een herroepingstermijn van 14 kalenderdagen te rekenen vanaf uw </span>
<span id="ty_2" class="t s2">Ontvangst van onze schriftelijke bevestiging van uw Contract. </span>
<span id="tz_2" class="t s2">3.3. U kan uw Contract op ieder moment beëindigen, zonder verbrekingsvergoeding, mits het respecteren van een </span>
<span id="t10_2" class="t s2">schriftelijke opzeg van 1 maand. Indien u op uw Afnamepunt op jaarbasis meer verbruikt dan 50 MWh elektriciteit </span>
<span id="t11_2" class="t s2">of 100 MWh aardgas, berekend op basis van uw geschat jaarlijks verbruik (EAV) zoals bepaald door de DNB, geldt in </span>
<span id="t12_2" class="t s2">afwijking van het voorgaande, dat u uw Contract van bepaalde duur enkel kan beëindigen op het einde van de lopende </span>
<span id="t13_2" class="t s2">duur mits een schriftelijke opzeg ten laatste 1 maand voor de afloop van de lopende periode. Indien u uw Contract </span>
<span id="t14_2" class="t s2">beëindigt voor de afloop van de lopende duur, bent u ons een opzegvergoeding verschuldigd die gelijk is aan 3 maal de </span>
<span id="t15_2" class="t s2">waarde van het gemiddeld verschuldigd maandbedrag berekend op basis van de 12 voorgaande maandfacturen of de </span>
<span id="t16_2" class="t s2">laatste jaarfactuur of een kortere periode indien u nog geen 12 maanden klant bij ons bent. Indien de DNB ons mee- </span>
<span id="t17_2" class="t s2">deelt dat u van energieleverancier bent veranderd, geldt dat voor ons als voldoende kennisgeving van uw opzegging, </span>
<span id="t18_2" class="t s2">voor zover de opzegtermijn werd gerespecteerd. </span>
<span id="t19_2" class="t s2">Wij kunnen een Contract van onbepaalde duur op elk moment beëindigen met een schriftelijke opzeg van 1 maand. </span>
<span id="t1a_2" class="t s2">Wij kunnen een Contract van bepaalde duur beëindigen mits een schriftelijke opzeg ten laatste 1 maand voor de afloop </span>
<span id="t1b_2" class="t s2">van de lopende periode. </span>
<span id="t1c_2" class="t s2">Indien wij uw standaardleverancier zijn, zullen wij het Contract enkel beëindigen in de gevallen bepaald in artikel 7.8. </span>
<span id="t1d_2" class="t s2">3.4. Het Contract wordt automatisch beëindigd in geval van faillissement of ontbinding van één van de partijen. De </span>
<span id="t1e_2" class="t s2">bedragen die verschuldigd zijn op het moment van het faillissement of de beslissing tot ontbinding worden onmiddellijk </span>
<span id="t1f_2" class="t s2">opeisbaar. In geval van gerechtelijke reorganisatie worden alle bedragen eveneens onmiddellijk opeisbaar en kan het </span>
<span id="t1g_2" class="t s2">Contract beëindigd worden indien betaling uitblijft binnen de 15 dagen na de ingebrekestelling. </span>
<span id="t1h_2" class="t s1">4. Prijzen </span>
<span id="t1i_2" class="t s2">4.1. De energieprijzen van ENGIE Electrabel worden vermeerderd met: </span>
<span id="t1j_2" class="t s2">- de btw; </span>
<span id="t1k_2" class="t s2">- alle belastingen, heffingen, retributies, vergoedingen, bijdragen, toeslagen en lasten (Toeslagen), die ons door een </span>
<span id="t1l_2" class="t s2">bevoegde overheid worden opgelegd, die wij moeten of mogen doorrekenen aan onze klanten, en die betrekking heb- </span>
<span id="t1m_2" class="t s2">ben op of volgen uit onze activiteit, in de meest ruime zin van het woord, als leverancier van elektriciteit of aardgas; </span>
<span id="t1n_2" class="t s2">- de Netwerkkosten. </span>
<span id="t1o_2" class="t s2">4.2. Meer informatie over onze prijzen vindt u op onze website </span><span id="t1p_2" class="t s3">www.engie-electrabel.be</span><span id="t1q_2" class="t s2">. </span>
<span id="t1r_2" class="t s2">4.3. De prestaties die de DNB voor u uitvoert in het kader van het afsluiten, het uitvoeren of het beëindigen van uw </span>
<span id="t1s_2" class="t s2">Contract, alsook alle kosten die hij ons rechtstreeks factureert en die betrekking hebben op uw Afnamepunt(en) zijn </span>
<span id="t1t_2" class="t s2">niet inbegrepen in onze prijzen en worden u dus doorgerekend. </span>
<span id="t1u_2" class="t s1">5. Wijziging van voorwaarden en prijzen </span>
<span id="t1v_2" class="t s2">5.1. Wij kunnen op elk moment wijzigingen doorvoeren van de prijzen en/of de voorwaarden die niet in uw nadeel zijn, </span>
<span id="t1w_2" class="t s2">op voorwaarde dat wij u hiervan op voorhand informeren via documenten die u aan huis of per e-mail ontvangt en/of </span>
<span id="t1x_2" class="t s2">via onze website </span><span id="t1y_2" class="t s3">www.engie-electrabel.be</span><span id="t1z_2" class="t s2">. </span>
<span id="t20_2" class="t s2">5.2. Voor prijsverhogingen en/of wijzigingen van de voorwaarden in uw nadeel gelden de volgende regels: </span>
<span id="t21_2" class="t s2">Deze prijsverhogingen en/of wijzigingen van de voorwaarden kunnen wij doorvoeren, op voorwaarde dat wij u minstens </span>
<span id="t22_2" class="t s2">2 maanden op voorhand hiervan informeren per post of per e-mail. Bij kennisgeving per post wordt de kennisgeving </span>
<span id="t23_2" class="t s2">geacht plaats te vinden op de Ontvangstdag; gebeurt de kennisgeving per email, dan is dit de datum van verzending. </span>
<span id="t24_2" class="t s2">Indien u de prijsverhoging en/of nieuwe voorwaarden niet aanvaardt, dan moet u ons dat per post meedelen binnen </span>
<span id="t25_2" class="t s2">de maand vanaf uw Ontvangst van onze kennisgeving. Deelt u ons uw weigering tijdig mee, dan houdt dit automatisch </span>
<span id="t26_2" class="t s2">in dat u uw Contract zonder kosten of schadevergoeding opzegt, om te eindigen op de dag waarop anders de nieuwe </span>
<span id="t27_2" class="t s2">prijzen en/of voorwaarden van kracht zouden worden. U dient dan desgevallend tijdig een andere leverancier te kiezen. </span>
<span id="t28_2" class="t s2">Afwezigheid van tijdige kennisgeving van uw weigering zal daarentegen betekenen dat u onze nieuwe prijzen en/of </span>
<span id="t29_2" class="t s2">voorwaarden aanvaardt. </span>
<span id="t2a_2" class="t s2">5.3. Als u verhuist wordt het Contract verder gezet op uw nieuwe adres en worden de gegevens van de BV in onderling </span>
<span id="t2b_2" class="t s2">overleg aangepast. Omwille van administratieve redenen dient u ENGIE Electrabel bij verhuis tenminste 20 kalender- </span>
<span id="t2c_2" class="t s2">dagen vóór de geplande verhuisdatum te verwittigen. Om een correcte slotfactuur te kunnen opmaken, moet u ENGIE </span>
<span id="t2d_2" class="t s2">Electrabel, uiterlijk 7 kalenderdagen na de effectieve verhuisdatum, de stand van de meterindexen van de door u tot op </span>
<span id="t2e_2" class="t s2">de verhuisdatum afgenomen energie, waarover u een schriftelijk akkoord dient te hebben met de nieuwe afnemer, en </span>
<span id="t2f_2" class="t s2">de naam en het adres van de nieuwe afnemer meedelen. </span>
<span id="t2g_2" class="t s1">6. Aansprakelijkheid </span>
<span id="t2h_2" class="t s2">6.1. De netbeheerders staan in voor de continuïteit van de levering van energie en de kwaliteit van de geleverde ener- </span>
<span id="t2i_2" class="t s2">gie overeenkomstig de bepalingen vervat in de toepasselijke wetgeving en reglementen. Bijgevolg zijn wij daarvoor </span>
<span id="t2j_2" class="t s2">niet aansprakelijk. In geval van schade ten gevolge van een onderbreking of een beperking van of onregelmatigheid in </span>
<span id="t2k_2" class="t s2">de levering van uw energie, dient u uw DNB aan te spreken. </span>
<span id="t2l_2" class="t s2">6.2. Onverminderd het voorgaande zijn wij en u enkel aansprakelijk voor rechtstreekse materiële schade die voorvloeit </span>
<span id="t2m_2" class="t s2">uit zware fout. De vergoeding van deze schade wordt in elk geval beperkt tot een jaarlijks bedrag van 5% van de </span>
<span id="t2n_2" class="t s2">jaarfactuur (voor elektriciteit of andere producten en diensten) en 3% van de jaarfactuur (voor aardgas). Bij gebreke </span>
<span id="t2o_2" class="t s2">aan een jaarfactuur wordt het gemiddeld maandbedrag van de beschikbare facturen vermenigvuldigd met 12, of bij </span>
<span id="t2p_2" class="t s2">gebreke aan beschikbare facturen wordt het overeengekomen maandelijks bedrag van de tussentijdse facturen ver- </span>
<span id="t2q_2" class="t s2">menigvuldigd met 12. ENGIE Electrabel en u zijn jegens elkaar niet aansprakelijk voor indirecte of gevolgschade, </span>
<span id="t2r_2" class="t s2">productieverlies, winstderving en/of gederfde inkomsten. In het algemeen zijn u en ENGIE Electrabel gehouden alle </span>
<span id="t2s_2" class="t s2">nodige redelijke maatregelen te nemen tot beperking van uw schade. </span>
<span id="t2t_2" class="t s2">6.3. U en ENGIE Electrabel nemen de verplichting op zich om de bepalingen van dit artikel ter kennis te brengen van </span>
<span id="t2u_2" class="t s2">uw/onze verzekeraar(s). </span>
<span id="t2v_2" class="t s1">7. Facturatie – interesten en kosten – rechtzetting - ontbinding </span>
<span id="t2w_2" class="t s2">7.1. De opname van uw meterstanden en de berekening van uw energieverbruik gebeurt door de DNB. Deze bezorgt </span>
<span id="t2x_2" class="t s2">deze gegevens aan ons, zodat wij op basis daarvan uw (maandelijkse of jaarlijkse) factuur kunnen opmaken. </span>
<span id="t2y_2" class="t s2">Indien uw meteropname maandelijks gebeurt, zal ENGIE Electrabel u maandelijkse facturen sturen. Indien ENGIE </span>
<span id="t2z_2" class="t s2">Electrabel uw maandelijkse verbruiksgegevens niet tijdig ontvangt van de DNB, kan ons geen enkele vertraging in </span>
<span id="t30_2" class="t s2">de facturatie verweten worden. ENGIE Electrabel behoudt zich bovendien het recht voor om de maandelijkse factuur </span>
<span id="t31_2" class="t s2">desnoods op te maken op basis van een geschat verbruik. </span>
<span id="t32_2" class="t s2">Indien uw meteropname jaarlijks gebeurt, zal ENGIE Electrabel u tussentijdse facturen sturen, waarbij het bedrag van </span>
<span id="t33_2" class="t s2">de tussentijdse facturen berekend wordt aan de hand van uw berekend verbruiksprofiel zoals bepaald door uw DNB. </span>
<span id="t34_2" class="t s2">De tussentijdse facturen worden verrekend op het moment van uw jaarlijkse factuur. Wij berekenen uw jaarlijkse </span>
<span id="t35_2" class="t s2">factuur over een periode van 1 jaar, of een kortere periode indien u het moment van opmaken van de jaarlijkse fac- </span>
<span id="t36_2" class="t s2">tuur nog geen volledig jaar klant bij ons bent. Indien wij uw verbruiksgegevens niet onmiddellijk na de meteropname </span>
<span id="t37_2" class="t s2">ontvangen, wordt uw verbruik aangevuld met een deel berekend verbruik voor de periode tussen de meteropname en </span>
<span id="t38_2" class="t s2">de datum van de jaarlijkse factuur. Dit berekend verbruik wordt op uw volgende jaarlijkse factuur aangepast volgens </span>
<span id="t39_2" class="t s2">uw werkelijk verbruik voor die periode. </span>
<span id="t3a_2" class="t s2">7.2. U dient de facturen uiterlijk binnen de 15 kalenderdagen na de Ontvangstdag te betalen. </span>
<span id="t3b_2" class="t s2">7.3. Het protesteren van een factuur of van elk ander document met betrekking tot de verschuldigde bedragen moet, </span>
<span id="t3c_2" class="t s2">op straffe van onontvankelijkheid, binnen de 15 dagen na Ontvangst ervan worden bekendgemaakt. Bij gebreke aan </span>
<span id="t3d_2" class="t s2">protest binnen voormelde termijn, wordt de factuur of elk ander document verondersteld te zijn aanvaard. </span>
<span id="t3e_2" class="t s2">Indien een fout in de facturatie wordt vastgesteld, zullen u en ENGIE Electrabel overleggen om tot een oplossing </span>
<span id="t3f_2" class="t s2">te komen. U zal in elk geval het niet betwiste deel van de factuur betalen. Indien het betwiste deel van de factuur </span>
<span id="t3g_2" class="t s2">toch verschuldigd blijkt te zijn, zullen intresten verschuldigd zijn sinds de oorspronkelijke vervaldatum van de factuur, </span>
<span id="t3h_2" class="t s2">conform art. 7.5. </span>
<span id="t3i_2" class="t s2">7.4. Rechtzetting is mogelijk tot 48 maanden na de uiterste betalingsdatum van de te verbeteren factuur. Facturen </span>
<span id="t3j_2" class="t s2">kunnen ook daarna worden rechtgezet indien een derde (de DNB bijv.) aan de oorsprong ligt van de verkeerde of </span>
<span id="t3k_2" class="t s2">laattijdige facturatie. </span>
<span id="t3l_2" class="t s2">7.5. ENGIE Electrabel heeft het recht om vanaf de vervaldatum van de factuur de betaling van intresten te vorderen, </span>
<span id="t3m_2" class="t s2">die berekend worden aan de intrestvoet voorzien in de wet van 2 augustus 2002 betreffende de betalingsachterstand </span>
<span id="t3n_2" class="t s2">bij handelstransacties of elke andere bepaling die deze wet zou vervangen. Deze intresten lopen van rechtswege en </span>
<span id="t3o_2" class="t s2">zonder ingebrekestelling. ENGIE Electrabel heeft eveneens het recht om in geval van laattijdige betaling een forfaitaire </span>
<span id="t3p_2" class="t s2">schadeloosstelling aan te rekenen ten belope van 10% van het openstaande factuurbedrag, met een minimum van 50€. </span>
<span id="t3q_2" class="t s2">7.6. Onverminderd de toepasselijke wettelijke bepalingen, zijn de kosten van herinneringen, ingebrekestellingen en </span>
<span id="t3r_2" class="t s2">invorderingen die ingevolge dit Contract door ENGIE Electrabel worden gemaakt, ten uwen laste. </span>
<span id="t3s_2" class="t s2">7.7. Bij laattijdige betalingen heeft ENGIE Electrabel het recht u te verzoeken een waarborg (m.n. in de vorm van een </span>
<span id="t3t_2" class="t s2">kaswaarborg) te stellen, die onherroepbaar is gedurende de gehele duur van het Contract verhoogd met 3 maanden, </span>
<span id="t3u_2" class="t s2">een bestaande waarborg te vermeerderen, en/of voorschotten te vragen. De waarborg en/of voorschotten kunnen ook, </span>
<span id="t3v_2" class="t s2">in de afwezigheid van laattijdige betalingen, bij de ondertekening van het Contract of tijdens de uitvoering ervan wor- </span>
<span id="t3w_2" class="t s2">den gevraagd indien objectieve en specifieke redenen dit rechtvaardigen. Het bedrag van de waarborg wordt berekend </span>
<span id="t3x_2" class="t s2">per energie en zal gelijk zijn aan 4 maal de waarde van een gemiddeld verschuldigd maandbedrag per energie met een </span>
<span id="t3y_2" class="t s2">minimum van 250€ per energie, indien uw verbruik gekend is. Indien uw verbruik niet gekend is, bedraagt de waarborg </span>
<span id="t3z_2" class="t s2">voor elektriciteit 500€ en voor aardgas 550€. </span>
<span id="t40_2" class="t s2">7.8. ENGIE Electrabel heeft het recht om het Contract te beëindigen, met onmiddellijke ingang en zonder rechterlijke </span>
<span id="t41_2" class="t s2">tussenkomst, in geval van niet naleving uwerzijds van één van de essentiële verplichtingen van dit Contract, aan </span>
<span id="t42_2" class="t s2">dewelke niet wordt verholpen binnen een termijn van 15 kalenderdagen na ingebrekestelling. Worden beschouwd als </span>
<span id="t43_2" class="t s2">essentiële verplichtingen (niet limitatieve opsomming): de betaling van de facturen op hun vervaldatum, het stellen van </span>
<span id="t44_2" class="t s2">een garantie of de betaling van de gevraagde voorschotten. </span>
<span id="t45_2" class="t s2">Indien wij naar aanleiding van een tekortkoming aan uw betalingsverplichting vragen een waarborg te stellen en/of </span>
<span id="t46_2" class="t s2">voorschotten te betalen, en u daar niet tijdig gevolg aan geeft, hebben wij het recht om het Contract zonder nieuwe </span>
<span id="t47_2" class="t s2">ingebrekestelling en zonder rechterlijke tussenkomst te beëindigen. </span>
<span id="t48_2" class="t s1">8. Volmacht </span>
<span id="t49_2" class="t s2">U geeft mandaat aan ENGIE Electrabel om in uw naam uw verbruiksgegevens over de laatste 3 jaren op te vragen bij </span>
<span id="t4a_2" class="t s2">de DNB met betrekking tot het (de) Afnamepunt(en) bepaald in de BV. </span>
<span id="t4b_2" class="t s1">9. Vertrouwelijkheid </span>
